import * as React from 'react';
import Property from '../../../components/Property';

const PropertyPage: React.FunctionComponent = () => (
  <Property
    properties={[
      {
        id: '1',
        title: 'Gebäude 1',
        rooms: [
          {
            id: '2',
            title: 'Room 2',
          },
        ],
      },
    ]}
  />
);
export default PropertyPage;
